import React, { useState, useEffect, useCallback } from 'react';
import { Table, TableHead, TableBody, TableRow, TableCell, TextField } from '@material-ui/core';
import debounce from 'lodash.debounce';
import Button from '@mui/joy/Button';

function ExpenseTable() {
    const [expenses, setExpenses] = useState([]);
    const [filters, setFilters] = useState({
        userId: 1,
        type: '',
        operationType: '',
        startDate: '',
        endDate: ''
    });

    const [newExpense, setNewExpense] = useState({
        userId: '',
        amount: '',
        operationType: '',
        type: '',
        date: ''
    });

    const formatDateTime = (dateString) => {
        if (!dateString) return '';
        const date = new Date(dateString);
        return date.toISOString().split('.')[0]; // Remove milliseconds
    };

    const fetchExpenses = async (filters) => {
        try {
            const queryParams = Object.fromEntries(
                Object.entries(filters).filter(([key, value]) => value)
            );
            const params = new URLSearchParams(queryParams).toString();
            const response = await fetch(`http://127.0.0.1:8080/expense/filter?${params}`, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                }
            });
            if (!response.ok) {
                throw new Error('Failed to fetch expenses');
            }
            const data = await response.json();
            setExpenses(data);
        } catch (error) {
            console.error('Error fetching expenses:', error);
        }
    };

    const addExpense = async (expense) => {
        try {
            const response = await fetch('http://127.0.0.1:8080/expense/add', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(expense)
            });
            if (!response.ok) {
                throw new Error('Failed to add expense');
            }
            // Fetch updated expenses after adding the new one
            fetchExpenses(filters);
        } catch (error) {
            console.error('Error adding expense:', error);
        }
    };

    const handleNewExpenseChange = (e) => {
        const { name, value } = e.target;
        setNewExpense(prevNewExpense => ({
            ...prevNewExpense,
            [name]: value
        }));
    };

    const handleAddExpense = () => {
        addExpense(newExpense);
        // Reset the new expense form
        setNewExpense({
            userId: '',
            amount: '',
            operationType: '',
            type: '',
            date: ''
        });
    };

    const debouncedFetchExpenses = useCallback(
        debounce((filters) => fetchExpenses(filters), 300),
        []
    );

    useEffect(() => {
        debouncedFetchExpenses(filters);
    }, [filters, debouncedFetchExpenses]);

    const handleFilterChange = (e) => {
        const { name, value } = e.target;
        setFilters(prevFilters => ({
            ...prevFilters,
            [name]: (name === 'startDate' || name === 'endDate') ? formatDateTime(value) : value
        }));
    };

    return (
        <div>
            <TextField
                name="userId"
                label="User ID"
                value={filters.userId}
                onChange={handleFilterChange}
            />
            <TextField
                name="type"
                label="Type"
                value={filters.type}
                onChange={handleFilterChange}
            />
            <TextField
                name="operationType"
                label="Operation Type"
                value={filters.operationType}
                onChange={handleFilterChange}
            />
            <TextField
                name="startDate"
                label="Start Date"
                type="datetime-local"
                value={filters.startDate}
                onChange={handleFilterChange}
                InputLabelProps={{
                    shrink: true,
                }}
            />
            <TextField
                name="endDate"
                label="End Date"
                type="datetime-local"
                value={filters.endDate}
                onChange={handleFilterChange}
                InputLabelProps={{
                    shrink: true,
                }}
            />
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>ID</TableCell>
                        <TableCell>User ID</TableCell>
                        <TableCell>Amount</TableCell>
                        <TableCell>Type</TableCell>
                        <TableCell>Operation Type</TableCell>
                        <TableCell>Date</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {expenses.map(expense => (
                        <TableRow key={expense.id}>
                            <TableCell>{expense.id}</TableCell>
                            <TableCell>{expense.userId}</TableCell>
                            <TableCell>{expense.amount}</TableCell>
                            <TableCell>{expense.type}</TableCell>
                            <TableCell>{expense.operationType}</TableCell>
                            <TableCell>{expense.date}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </div>
    );
}

export default ExpenseTable;
